import React from "react";
import GlobalStyle from "../../styles/Global.css";
import { Avatar } from 'primereact/avatar';
import { useNavigate } from "react-router";

const { SideBar } = GlobalStyle

function SideBarComp() {

    const navigate = useNavigate()

    return (
        <>
            <SideBar>
                <Avatar onClick={() => {navigate("/Account")}} label="U" size="xlarge" style={{ backgroundColor: '#9c27b0', color: '#ffffff', marginBottom: "30px" }}></Avatar>
                <Button style={{ marginBottom: "auto", backgroundImage: "url(https://img.icons8.com/?size=256&id=NjzqV0aREXb6&format=png)" }} icon="pi pi-check" aria-label="Filter" />
                <Button icon="pi pi-check" aria-label="Filter" />
            </SideBar>
        </>
    )
}

export default SideBarComp
